import React from 'react';
import { musicalInstruments } from '../data/musicalInstruments';
export default class View extends React.Component {

    constructor(props: {instrument: typeof musicalInstruments}) {
        super(props);
        // this.state = {description}
    }

    render() {
        const projectName = this.props.description;
        const adress = this.props.details.adress;
        const phoneNumber = this.props.details.phoneNumber;
        const description = this.props.details.description;
        return <div>
            <h1> {projectName} </h1>
            <h3> {adress} </h3>
            <h3> {phoneNumber} </h3>
            <h3> {description} </h3>
        </div>
    }
}
